import React from 'react';
import styled from 'styled-components';
import palette from '../../lib/styles/palette';
import Responsive from '../common/Responsive';
import { Link } from 'react-router-dom';

const MainSubMenuBackground = styled.div`
  padding-top: 3rem;
  width: 100%;
  background-image: url('https://cdn.pixabay.com/photo/2017/05/13/18/36/cat-2310384_960_720.jpg');
  @media (max-width: 768px) {
    margin-top: 3rem;
  }
`;

const MainSubMenuHolder = styled(Responsive)`
  height: 20rem;
  display: flex;
  justify-content: space-between;
  @media (max-width: 1152px) {
    height: 15rem;
  }
  @media (max-width: 768px) {
    height: 10rem;
  }
`;

const SubMenuItem = styled.div`
  width: 17%;
  padding-top: 100%;
  position: relative;
  border: 1px solid red;
`;

const SubMenuCircle = styled(Link)`
  display: flex;
  position: absoute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  border: 1px solid blue;
  border-radius: 50%;
`;

const SubMenuItemTitleHolder = styled.div`
  width: 100%;
  text-align: center;
  margin-top: 1rem;
  h1 {
    font-size: 1rem;
    margin: 0;
  }
  h2 {
    font-size: 1rem;
    margin: 0;
  }
`;

const MainSubMenu = () => {
  return (
    <MainSubMenuBackground>
      <MainSubMenuHolder>
        <SubMenuItem className="proportion">
          <SubMenuCircle />
          <SubMenuItemTitleHolder>
            <h1>asdf</h1>
            <p>asdfasdf</p>
          </SubMenuItemTitleHolder>
        </SubMenuItem>
        <SubMenuItem>
          <SubMenuCircle />
        </SubMenuItem>
        <SubMenuItem>
          <SubMenuCircle />
        </SubMenuItem>
        <SubMenuItem>
          <SubMenuCircle />
        </SubMenuItem>
        <SubMenuItem>
          <SubMenuCircle />
        </SubMenuItem>
      </MainSubMenuHolder>
    </MainSubMenuBackground>
  );
};

export default MainSubMenu;
